def kmer_counting(seq, k,upper_bound):
    kmer_dict = {}
    kmer_pos = {}
    kmers = []
    for i in range(len(seq) - k + 1):
        kmer = seq[i:i + k]
        if kmer not in kmer_pos:
            kmer_pos[kmer] = list()
        kmer_pos[kmer].append(i)

        kmers.append(kmer)
        if kmer not in kmer_dict.keys():
            kmer_dict[kmer] = 1
        else:
            kmer_dict[kmer] += 1
    high_occ_kmers = [{'kmer': i, 'startpos': elem, 'endpos': elem + k - 1,
                       'identifier': i} for i, v in kmer_dict.items() if v > upper_bound for elem in
                      kmer_pos[i]]
    if high_occ_kmers:
        return True
    else:
        return False


if __name__ == "__main__":
    print(kmer_counting(
        "", 20,1))
    print(kmer_counting("ACGTACGTACGTACGTACGTACGTACGTACGTACGTACGT",20,1))
